import KanbanBoard from './components/KanbanBoard';


class App extends Component {
  constructor() {
    super()

    this.state = {
      lists: [ {title: 'To Do'},{title: 'In Progress'},{title: 'Completed'} ]
    }
  }
  render() {
    return (
      <div>
        <KanbanBoard />
      </div>
    );
  }
}

export default App;
